import React from "react";
import { Tr, Td,Button } from '@chakra-ui/react'

const Itemshop = ({data})=>{ 
    return(
    <>
      <Tr>
        <Td>{data.nombre}</Td>
        <Td><Button colorScheme='blackAlpha'>+</Button> {data.cant}<Button colorScheme='blackAlpha'>-</Button></Td>
        <Td isNumeric>$ {data.precio}</Td>
      </Tr>
    </>    
    )
}

export default Itemshop
